import React from "react";
import { useForm, ValidationError } from "@formspree/react";
function ContactForm() {
  const [state, handleSubmit] = useForm("xwkaqqeg");
  if (state.succeeded) {
    return (
      <div className="container   bg-light" style={{ padding: "5rem" }}>
        {" "}
        <p className="display-3">Thank you for contacting me!</p>
        <p> I will get back to you as soon as possible.</p>
      </div>
    );
  }
  return (
    <div className="container   bg-light" style={{ padding: "5rem" }}>
      <form onSubmit={handleSubmit}>
        <label className="form-label" htmlFor="email">
          Email Address
        </label>
        <input className="form-control" id="email" type="email" name="email" />
        <ValidationError
          className="valid-feedback"
          prefix="Email"
          field="email"
          errors={state.errors}
        />
        <label className="form-label" htmlFor="message">
          Your Message
        </label>
        <textarea className="form-control" id="message" name="message" />
        <ValidationError
          prefix="Message"
          field="message"
          className="valid-feedback"
          errors={state.errors}
        />
        <button type="submit" disabled={state.submitting}>
          Submit
        </button>
      </form>
    </div>
  );
}

export default ContactForm;
